import React, {Component} from 'react';
import Layout from '../components/Layout'
//import Me from '../static/images/IMG_0709.jpg'


class Home extends Component {
  render() {
    return (
        <Layout>
            <div className="container about">
                <div className="centerLanding">
                    <h1>Alex Do</h1>
                    <h3>UW-Madison '21</h3>
                </div> 
            </div>
            <div className="container projects">
                <div className="row">
                    <div className="col portrait">
                        {/* <img src="../static/images/IMG_0709.jpg" alt="me"/> */}
                    </div>
                    <div className="col">
                        <h3>Hi, I'm Alex</h3>
                    </div>
                </div>
            </div>
            <div className="container-fluid skills">
                <div className="row">
                    <div className="col">
                        <h3>Java</h3>
                        <p>is the language I primarily use in my computer science courses</p>
                    </div>
                    <div className="col">
                        <h3>Python</h3>
                        <p>a fun language I'm picking up. I use it for my research and for personal projects</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col">
                        <h3>JavaScript</h3>
                        <p>currently learning it to develop this website; it has so much potential and is used everywhere</p>
                    </div>
                    <div className="col">
                        <h3>C/C++</h3>
                        <p>tougher language than most, but I want to get more into lower-level programming, so I will have to suck it up</p>
                    </div>
                </div>
            </div>




            <style jsx>{`
                // .landing {
                //     background-image: url(../static/images/IMG_1093.jpg);
                //     height: 100vh;
                //     background-size: cover;
                //     background-position: center center;
                //     background-repeat: no-repeat;
                //     position: relative;
                //   }

                  .centerLanding {
                    color: white;
                    position: absolute;
                    top: 50%;
                    left: 50%;
                    transform: translateX(-50%) translateY(-50%);

                  }

                  .aboutMe {
                    position: relative;
                    margin-top: 30px;
                    margin-bottom: 30px;
                  }

                  .portrait {
                    background-image: url(../static/images/IMG_0709.jpg);
                    background-size: cover;
                    background-position: center center;
                    background-repeat: no-repeat;
                    border-radius: 50%;
                    height: 325px;
                    width: 75%;

                  }

                  .row {
                    padding: 50px;
                  }

                  .hello .col #js {
                    margin: 0;
                    margin-right: 0;
                    background-color: yellow;
                  }

                  .js {
                    background-color: yellow;
                  }
            `}</style>
        </Layout>
    );
  }
}

export default Home;
